function NavBtn(){const e=document.querySelector(".nav-links");e.classList.toggle("nav-active")}function NavSection(){const e=document.querySelector("#menu-btn"),t=document.querySelector(".nav-links"),n=document.querySelector(".NavBar");t.classList.toggle("nav-active"),e.classList.toggle("open"),n.classList.add("nav-blur")}function NavSocial(){const e=document.querySelector(".nav-links"),t=document.querySelector("#menu-btn"),n=document.querySelector(".NavBar");e.classList.toggle("nav-active"),t.classList.toggle("open"),n.classList.add("nav-blur")}function NavBlur(){const e=document.querySelector(".NavBar");e.classList.toggle("nav-blur")}